USE cw_ods_risk_engine_all;
CREATE TABLE cw_ods_risk_engine_all(
    order_no_deo VARCHAR(255) PRIMARY KEY,
    actual_pay_type_deo VARCHAR(255),
    bank_code_pic VARCHAR(255),
    user_bank_deo VARCHAR(255),
    certificate_create_time_deo VARCHAR(255),
    certificate_dimensions_deo VARCHAR(255),
    certificate_edit_time_deo VARCHAR(255),
    certificate_format_deo VARCHAR(255),
    certificate_size_deo BIGINT,
    check_bank_pic INT,
    check_camera_pic INT,
    client_ip_deo VARCHAR(255),
    client_ip_location_deo VARCHAR(255),
    client_type_deo VARCHAR(255),
    client_version_deo VARCHAR(255),
    credit_rate_deo VARCHAR(255),
    device_manufacturer_pic VARCHAR(255),
    device_no_deo VARCHAR(255),
    device_source_deo VARCHAR(255),
    file_size_pic VARCHAR(255),
    file_type_extension_pic VARCHAR(255),
    group_name_deo VARCHAR(255),
    image_size_pic VARCHAR(255),
    is_android_ios_pic VARCHAR(255),
    is_screenshot_pic VARCHAR(255),
    is_valid_font_easy_read_pic VARCHAR(255),
    is_valid_font_margin_pic BOOLEAN,
    megapixels_pic BIGINT,
    member_grade_deo VARCHAR(255),
    order_amount_deo BIGINT,
    order_complete_time_deo VARCHAR(255),
    order_confirm_time_deo VARCHAR(255),
    order_create_time_deo VARCHAR(255),
    order_deposit_name_deo VARCHAR(255),
    order_status_deo VARCHAR(255),
    pay_type_deo VARCHAR(255),
    pic_total_num_pic BIGINT,
    profile_copyright_pic VARCHAR(255),
    sender_bank_deo VARCHAR(255),
    site_name_deo VARCHAR(255),
    source_offset BIGINT,
    total_amount_usr BIGINT,
    total_bill_usr BIGINT,
    transfer_acc_received_deo VARCHAR(255),
    transfer_acc_sender_deo VARCHAR(255),
    transfer_name_received_deo VARCHAR(255),
    transfer_name_sender_deo VARCHAR(255),
    transfer_time_deo VARCHAR(255),
    user_name_deo VARCHAR(255),
    font_id_pic BIGINT,
    order_bill_deo BIGINT
);
CREATE INDEX order_create_time_deo_index ON cw_ods_risk_engine_all(order_create_time_deo);
CREATE INDEX client_ip_deo_index ON cw_ods_risk_engine_all(client_ip_deo);
CREATE INDEX user_bank_deo_index ON cw_ods_risk_engine_all(user_bank_deo);
CREATE INDEX device_no_deo_index ON cw_ods_risk_engine_all(device_no_deo);
CREATE INDEX user_site_name_index ON cw_ods_risk_engine_all(user_name_deo, site_name_deo);
CREATE TABLE cw_ods_label(
    order_no_deo VARCHAR(255) PRIMARY KEY,
    isFake BOOLEAN
);

